import React, {createElement} from 'react';
import '@axa-ch/button'
import createAXATable from '@axa-ch/table/lib/index.react';

const AXATableReact = createAXATable(createElement);


export default function TranslationTable() {


        function mapTranslationToTableRow() {
            // @ts-ignore
            return (
                <div></div>
            );
        }


        return (
            <axa-table-sortable innerscroll="500">
                <table className="any-for-test">
                    <thead>
                    <tr>
                        <th>Titel 1</th>
                        <th>Titel 2</th>
                        <th>Titel 3</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td>Body 1</td>
                        <td className="o-table--light">Longer Body 2</td>
                        <td className="o-table--bold">Super Long Body 3</td>
                    </tr>
                    <tr>
                        <td>Body A1 AA</td>
                        <td className="o-table--light">Longer Body A2</td>
                        <td className="o-table--bold">Super Long Body A3</td>
                    </tr>
                    <tr>
                        <td>Body B1</td>
                        <td className="o-table--light">Longer Body B2</td>
                        <td className="o-table--bold">Super Long Body B3</td>
                    </tr>
                    </tbody>
                </table>
            </axa-table-sortable>
        );
}
